export default class SubscriptionHandle {
    /** @type {{(): void} | null} */
    _call: {
        (): void;
    } | null;
    /** @type {boolean} */
    _unsubscribed: boolean;
    /**
     * @param {() => void} call
     * @returns {void}
     */
    _setCall(call: () => void): void;
    unsubscribe(): void;
}
